import './Tab.css';

function Tab( { entries }) {
    return (
        <div className="tab">
            {
              Object.keys(entries).map( title => {
                return ( 
                <div key={title} className="tab__entry">
                    <button className="tab__title">
                        <span className="tab__title-text">{title}</span>
                    </button>
                    <div className="tab__body">{entries[title]}</div>
                </div> 
                );
              })
            }   
        </div>
    );
}

export default Tab;
